import samsung from '../Img/samsung.jpeg'
export default function Produits(){
    let tabProduit=[
        {libelle:"Oppo",prix:600,enpromo:Boolean=true,catheg:"tel",img:"../Img/oppo.jpeg"},
        {libelle:"samsung",prix:670,enpromo:Boolean=false,catheg:"tel",img:"../Img/samsung.jpeg"},
        {libelle:"Infix",prix:500,enpromo:Boolean=true,catheg:"tel",img:"./img/Infix.jpg"}
      ]
    return <div>
      {
          tabProduit.map((data)=>{
              let image=data.img;
              console.log(image)
              return <div><h1>{data.libelle}</h1><br/>
              <img src={require(this.image)}/> 
              prix:{data.prix} promotion:{data.enpromo}
              </div>
          })
      }
    </div>
}
